import Slider from "../../components/Slider";
import sliderData from "../../components/Slider/indexData";
import filmBorder from "../../assets/images/filmborder.png";

const Landing = () => {
  return (
    <Slider>
      <img
        src={filmBorder}
        alt={sliderData[0]}
        style={{
          backgroundImage: `url(${sliderData[0]})`,
          backgroundPosition: "center",
          backgroundSize: "95% 69%",
          backgroundRepeat: "no-repeat",
        }}
      />
      <img
        src={filmBorder}
        alt={sliderData[1]}
        style={{
          backgroundImage: `url(${sliderData[1]})`,
          backgroundPosition: "center",
          backgroundSize: "95% 69%",
          backgroundRepeat: "no-repeat",
        }}
      />
      <img
        src={filmBorder}
        alt={sliderData[2]}
        style={{
          backgroundImage: `url(${sliderData[2]})`,
          backgroundPosition: "center",
          backgroundSize: "95% 69%",
          backgroundRepeat: "no-repeat",
        }}
      />
      <img
        src={filmBorder}
        alt={sliderData[3]}
        style={{
          backgroundImage: `url(${sliderData[3]})`,
          backgroundPosition: "center",
          backgroundSize: "95% 69%",
          backgroundRepeat: "no-repeat",
        }}
      />
      <img
        src={filmBorder}
        alt={sliderData[4]}
        style={{
          backgroundImage: `url(${sliderData[4]})`,
          backgroundPosition: "center",
          backgroundSize: "95% 69%",
          backgroundRepeat: "no-repeat",
        }}
      />
      <img
        src={filmBorder}
        alt={sliderData[5]}
        style={{
          backgroundImage: `url(${sliderData[5]})`,
          backgroundPosition: "center",
          backgroundSize: "95% 69%",
          backgroundRepeat: "no-repeat",
        }}
      />
      <img
        src={filmBorder}
        alt={sliderData[6]}
        style={{
          backgroundImage: `url(${sliderData[6]})`,
          backgroundPosition: "center",
          backgroundSize: "95% 69%",
          backgroundRepeat: "no-repeat",
        }}
      />
      <img
        src={filmBorder}
        alt={sliderData[7]}
        style={{
          backgroundImage: `url(${sliderData[7]})`,
          backgroundPosition: "center",
          backgroundSize: "95% 69%",
          backgroundRepeat: "no-repeat",
        }}
      />
      <img
        src={filmBorder}
        alt={sliderData[8]}
        style={{
          backgroundImage: `url(${sliderData[8]})`,
          backgroundPosition: "center",
          backgroundSize: "95% 69%",
          backgroundRepeat: "no-repeat",
        }}
      />
      <img
        src={filmBorder}
        alt={sliderData[9]}
        style={{
          backgroundImage: `url(${sliderData[9]})`,
          backgroundPosition: "center",
          backgroundSize: "95% 69%",
          backgroundRepeat: "no-repeat",
        }}
      />
      <img
        src={filmBorder}
        alt={sliderData[10]}
        style={{
          backgroundImage: `url(${sliderData[10]})`,
          backgroundPosition: "center",
          backgroundSize: "95% 69%",
          backgroundRepeat: "no-repeat",
        }}
      />
      <img
        src={filmBorder}
        alt={sliderData[11]}
        style={{
          backgroundImage: `url(${sliderData[11]})`,
          backgroundPosition: "center",
          backgroundSize: "95% 69%",
          backgroundRepeat: "no-repeat",
        }}
      />
    </Slider>
  );
};
export default Landing;
